"Excellent!" I said. "I've already photographed you once before so you're a pro at how all this goes. Let's get creative this time around." 
"I want to be photographed raw and real. It doesn't have to be pretty. I just want something this is emotional and represents this time in my life. I've gone through so much and I want to create that feeling." 

These stories that pictures create, the emotions they bring, the reality they convey, and the story they tell are everything. 
Sometimes our lives are not pretty. 
Often times they are messy and chaotic.
How many times have you wished for a storm to pass? 
For the light and warmth of a new day to shine? 
. . . to just feel ok again? 
The trails of life beat against us and it can feel as though it will never end. We can be left asking, "what was the point? Why this? Why me? Why now!" 
I don't know the answer to these questions.
But I do know if you can endure, if you can keep the faith, if you can hold on, if you can just stick through it, then you'll leave that stormy sea a different person . . . stronger, braver. 

That's Michelle. 
A woman who has constantly, repeatedly battled the stormy seas of life, and held on. She's persevered through the tears and disappointments and losses. She's held her head high as the storm beat around her and she survived. 
She thrived. 
She grew. 
She became and that lead us to see something we hadn't seen before . . . that dark and difficult parts of Michelle's story are just as beautiful as everything else. 
It's in those stormy seasons that she's seen who she really is . . . 
strong,
capable, 
and unquestionably, beautiful. 

If you find yourself looking at your life and you have a desire to see the raw, beautiful reality even though it might not be traditionally pretty or even 'a little different', you're invited here. I can show you that no matter how different your story may seem, it is beautiful because it is YOURS. 

Huge thank you to Lindsay for her skilled makeup and hair artistry and incredible behind the scenes assisting. 

